SET XACT_ABORT ON;  
BEGIN TRY  
    BEGIN TRANSACTION; 
        DECLARE 
            @cur_denomination VARCHAR(MAX), 
            @cur_cip13  BIGINT = 0,
	        @nb_lignes	INT = 0;
        DECLARE c1_cursor CURSOR  
            FOR select QQCHOSE.denomination, QQCHOSE.cip13
			        from (select CCB.cip13 as cip13, CONCAT ( CB.denomination,' ',CCB.libelle_prez,' [', CB.administration, ']') as denomination, CB.etat_com
						        FROM  LENOVO.[CIS].[dbo].[cis_bdpm] CB, LENOVO.[CIS].[dbo].[cis_cip_bdpm] CCB
						        WHERE CB.cis = CCB.cis) as QQCHOSE
			        WHERE CAST(QQCHOSE.etat_com AS nVARCHAR(255)) LIKE 'Commercialis%'
			        order by QQCHOSE.denomination
        OPEN c1_cursor  
        FETCH NEXT FROM c1_cursor INTO @cur_denomination, @cur_cip13;
        WHILE @@FETCH_STATUS = 0  
        BEGIN
	        IF EXISTS(SELECT 1 FROM [dbo].[medicaments] WHERE [dbo].[medicaments].id = @cur_cip13)
		        BEGIN
			        UPDATE [dbo].[medicaments] SET nom=@cur_denomination WHERE [dbo].[medicaments].id = @cur_cip13
		        END
	        ELSE
		        BEGIN
			        SET IDENTITY_INSERT [dbo].[medicaments] ON
		        END
	        FETCH NEXT FROM c1_cursor INTO @cur_denomination, @cur_cip13;
        END   
        CLOSE c1_cursor;  
        DEALLOCATE c1_cursor
    -- If the DELETE statement succeeds, commit the transaction.  
    COMMIT TRANSACTION;  
END TRY  
BEGIN CATCH  
    -- Execute error retrieval routine.  
    EXECUTE usp_GetErrorInfo;  
  
    -- Test XACT_STATE:  
        -- If 1, the transaction is committable.  
        -- If -1, the transaction is uncommittable and should   
        --     be rolled back.  
        -- XACT_STATE = 0 means that there is no transaction and  
        --     a commit or rollback operation would generate an error.  
  
    -- Test whether the transaction is uncommittable.  
    IF (XACT_STATE()) = -1  
    BEGIN  
        CLOSE c1_cursor;  
        DEALLOCATE c1_cursor
        PRINT  
            N'The transaction is in an uncommittable state.' +  
            'Rolling back transaction.'  
        ROLLBACK TRANSACTION;  
    END;  
  
    -- Test whether the transaction is committable.
    -- You may want to commit a transaction in a catch block if you want to commit changes to statements that ran prior to the error.
    IF (XACT_STATE()) = 1  
    BEGIN  
        PRINT  
            N'The transaction is committable.' +  
            'Committing transaction.'  
        COMMIT TRANSACTION;     
    END;  
END CATCH;  
GO  
